DELIMITER $$
CREATE TRIGGER `trg_ai_menu` BEFORE INSERT ON `menu` FOR EACH ROW BEGIN
    IF NEW.menucode IS NULL OR NEW.menucode = '' THEN
        SET @max_code = (SELECT MAX(SUBSTRING(menucode, 2)+0) FROM menu);
        SET NEW.menucode = CONCAT('M', LPAD(IFNULL(@max_code+1, 1), 3, '0'));
    END IF;
END
$$
DELIMITER ;

