DELIMITER $$
CREATE TRIGGER `trgInsertTransDetail` AFTER INSERT ON `transactiondetail` FOR EACH ROW BEGIN
    DECLARE subprice DECIMAL(10, 2);
    SET @quantity = NEW.transqty;
    SET @menuCode = NEW.menucode;
    SET @code = NEW.transcode;
    SELECT menuprice INTO subprice FROM menu WHERE menucode = @menuCode;
    SET subprice = subprice * @quantity;
    
    UPDATE transactionheader
    SET transtotal = transtotal + subprice
    WHERE transcode = @code;
END
$$
DELIMITER ;
